import Header from "../Header";
import "./dashboard.css"
function Dashboard(){


    function load (){
      if(sessionStorage.getItem("name")=="" || sessionStorage.getItem("name")==null ){
        window.location.href="/Signup";
      }
      var view = document.querySelector("#name")

      console.log(view);

      //  view.innerHTML = sessionStorage.getItem("name").toUpperCase()+" "+sessionStorage.getItem("lastname").toUpperCase();

    //  var logologo= document.querySelector("#logo-logo");
    //  console.log(logologo)
    //  logologo.style.display="none";
    }

    setTimeout(load(),1000)


    return(
      <div>
        <h3 style={{textAlign:"center",padding:""}}>Hello, welcome Agent <span id="name"> {sessionStorage.getItem("name").toLocaleUpperCase()}</span> </h3>
        <p className="names" id="nn3"> </p>
      <div id="container">


        <div className="personal information" style={{textAlign:"left"}}>
          <p>Fullname:{" "+sessionStorage.getItem("name")+""}  {sessionStorage.getItem("lastname")}<br></br></p>
          <p>State Of Origin: {""+sessionStorage.getItem("SOO")}</p>
          <p>Age: {""+sessionStorage.getItem("age")}</p>
          <p>Jobtype: {""+sessionStorage.getItem("jobtype")}</p>
          <p>Status: Unemployed</p>
          <p>Phone Number: {""+sessionStorage.getItem("pnumber")}</p>



        </div>
        <div id="data" style={{display:"none"}}></div>



        </div>
        <div id="available_jobs">
        <h3 style={{textAlign:"center"}}>Available Jobs Near me</h3>
        </div>
      </div>
    );
  }

  export default Dashboard;
